    [],nt"num_tags": 1,nt"name": "st-croix-wetland-management-district-annual-narrative-report-calendar-year-1993",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for St. Croix
    Wetland Management District summarizes district activities during the 1993 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.   Land acquisition is also covered.  The report includes a planning
    section which discusses master plan, management plan, public participation, compliance
    with environmental and cultural mandates, research and investigations and other.
     Refuge administration is outlined; information about personnel, youth programs,
    other manpower programs, volunteer programs, funding, safety, technical assistance,
    and other items is given.  Habitat management is also covered.  Subjects include
    general, wetlands, croplands, grasslands, other habitats, grazing, haying, fire
    management, pest control, water rights, wilderness and special areas, and WPA easement
    monitoring, pest control.  The wildlife section of the report discusses wildlife
    diversity, endangered and/or threatened species, waterfowl, marsh and waterbirds,
    shorebirds, gulls, terns, and allied species, raptors, other migratory birds, games
    animals, other resident wildlife, fisheries resources, wildlife propagation and
    stocking, scientific collections, animal control, marking and banding, and disease
    prevention and control.  The public uses of the refuge described in this report
    include general, hunting, fishing, trapping, wildlife observation, other wildlife
    oriented recreation, and law enforcement.  The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, equipment utilization and replacement, communication systems, computer
    systems, energy conservation, and other.  Items of interest are provided at the
    end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
